import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

const App = () => {
  return(
    <>
      <Router>
        <div>
          <Switch>
            <Route path="/login">
              {/* <LoginPage /> */}
            </Route>
            <Route path="/register">
              {/* <RegisterPage /> */}
            </Route>
            <Route path="/">
              {/* <Home /> */}
              <h1>HOME PAGE</h1>
            </Route>
          </Switch>
        </div>
      </Router>
    </>
  )
};

export default App;
